    false,nt"url": null,nt"notes": "This narrative report for South Carolina
    National Wildlife Refuge outlines Refuge accomplishments from November, 1940 to
    January, 1941. The report begins by summarizing the weather conditions during this
    period. Wildlife- including migratory birds, upland game birds, furbearers, predators,
    and mammals- is also covered. The Refuge development and maintenance section discusses
    physical developments, plantings, and collections and receipts. Resource management
    is outlined; topics include cooperative farming and timber removal. A progress report
    on field investigations and applied research is also provided. Photographs are attached.",nt"owner_org":
